require 'hdf5'
 

local DataHandler = torch.class('DataHandler')
function DataHandler:__init(args)
  --four files which be prepared previously
    self.train_data_file = args.train_data_file
    --self.train_meta_file = args.train_meta_file
    self.val_data_file = args.val_data_file
   -- self.val_meta_file = args.val_meta_file
    self.seq_len = args.seq_len --we use 30 frames
    self.num_classes = args.num_classes --we use 20 classes to do the demo
    self.pos_class = args.pos_class --positive sample
    self.data_dim = args.data_dim   -- we use 4094 dims

    self.neg_classes = {}  -- negative sample
    for i=1,self.num_classes do --class ranked by number 
        if i ~= self.pos_class then --add neg to neg class table
            table.insert(self.neg_classes, i)
        end
    end

    self.batch_size_pos = args.batch_size_pos --batch of pos samples  they used 50, we have changed
    self.batch_size_neg = args.batch_size_neg --batch of pos samples  they use 2
    self.batch_size = self.batch_size_pos + #self.neg_classes*self.batch_size_neg -- total batch

    self.train_data = hdf5.open(self.train_data_file,'r')
